    {
      nome: 'Piratas da Big Mom',
      corPrimaria: '#FFBA05',
      corsegundaria: '#FFF5D9'
    },
    {
      nome: 'Cipher Pol Number 9',
      corPrimaria: '#FF8A29',
      corsegundaria: ''
    }
  ]

  const [Otakus, setOtakus] = useState([])

  const NovoOtakuInserido = (Otaku) => {
    console.log(Otaku)
    setOtakus([...Otakus, Otaku])
  }

  return (
    <div className="App">
      <Banner />
      <Formulario OtakuInserido={Otaku => NovoOtakuInserido(Otaku)}/>
    <Time nome="Família Charlotte"/>
    <Time nome="Piratas do Barba Negra"/>
    <Time nome="Piratas das Feras"/>
    <Time nome="Piratas Donquixote"/>
    <Time nome="Marinha"/>
    <Time nome="Piratas da Big Mom"/>
    <Time nome="Cipher Pol Number 9"/>
    </div>
  );
}

export default App;
